// pages/UserDashboard.jsx
import React from "react";
import { Outlet, useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const UserDashboard = () => {
  const navigate = useNavigate();

  return (
    <>
      <style>{/* Keep your custom styles here */}</style>

      <div className="relative min-h-screen flex flex-col text-white bg-black">
        {/* Background image */}
        <div
          className="absolute inset-0 bg-cover bg-center"
          style={{
            backgroundImage:
              "url('https://images.unsplash.com/photo-1498050108023-c5249f4df085?auto=format&fit=crop&w=1470&q=80')",
            zIndex: 0,
          }}
        />
        <div
          className="absolute inset-0 bg-black bg-opacity-70"
          style={{ zIndex: 5 }}
        />

        <Navbar />

        {/* Page Content */}
        <main className="flex-grow pt-24 px-6 relative z-10 max-w-7xl mx-auto">
          <Outlet />
        </main>

        <Footer />
      </div>
    </>
  );
};

export default UserDashboard;
